import React, { Component } from 'react'

export default class Right extends Component {

    constructor(props) {
        super(props)

        this.state = {
             projects:
             [
                 'Jedmap',
                 'Brand Guidliness',
                 'Investment Guide Africa'
             ]
        }
    }


    render() {
        return (
            <div className='right main'>
                <ul className='projects'>
                    {this.props.state.projects.map((project) => (
                        <div>{project}</div>
                    ))}
                </ul>
            </div>
        )
    }
}
